import React from "react";
import { Navbar, Nav, FormControl, Container } from "react-bootstrap";
class ChoiceSection extends React.Component {
  render() {
    return (
      <section className="choice">
        <h1 className="choice__title">MagicTap</h1>
        <section className="choice__menu">
          <h2 className="choice__menu__title">Menu</h2>
          <Navbar collapseOnSelect expand="md">
            <Container>
              <Navbar.Collapse>
                <Nav>
                  <Nav.Link href="/benefits">Benefits</Nav.Link>
                  <Nav.Link href="/profile">My Profile</Nav.Link>
                </Nav>
              </Navbar.Collapse>
            </Container>
          </Navbar>
        </section>
      </section>
    );
  }
}

export default ChoiceSection;
